import React from 'react';
import { TituloPrincipal } from './style'
import logoLabenu from './'

function Header() {
    return (
        
        <section>
           <img src={logoLabenu} alt="Logo da Labenu" />
            <TituloPrincipal>ZapLab</TituloPrincipal>
        </section>
    )
}

export default Header;
